import React from 'react'
import Img from "./CardData"
import Card from "./Card"


function Regards() {
    let Img = [
        {
            src: "./img/1.jpg",
            link: "https://www.github.com/ahmadraza100"
        },
        {
            src: "./img/2.jpg",
            link: "https://www.github.com/ahmadraza100"
        },
        {
            src: "./img/3.jpg",
            link: "https://www.github.com/ahmadraza100"
        },
        {
            src: "./img/4.jpg",
            link: "https://www.github.com/ahmadraza100"
        },
        {
            src: "./img/5.png",
            link: "https://www.github.com/ahmadraza100"
        },
        {
            src: "./img/6.png",
            link: "https://www.github.com/ahmadraza100"
        },
        {
            src: "./img/7.png",
            link: "https://www.github.com/ahmadraza100"
        },
    
    ]
    return (
        <div>
            {Img.map((val)=>{
                return (
                    <Card src = {val.src}
                        href={val.link}/>
                )
            })}
        </div>
    )
}

export default Regards
